        <select name="activity">
          <option >Chose an activity</option>
          <option value="Run">Run</option>
          <option value="Swimming">Swimming</option>
          <option value="Bike">Bike</option>
        </select>
        <input type="date" name="date"></input>
      </form>
    </div>
  );
}

export default App;
